import React from "react";
import Logo from "../img/whitelogo.png";
function Footer() {
  return (
    <footer className="footer">
      <div className="container">
        <div className="row">
          <div className="col">
            <div class="block">
              <figure><img src={Logo} alt="Logo" /></figure>
              <h1 class="title">CARE CLUB</h1>
              <p>a little one sentence description of the wensite or a cahy quote</p>
            </div>
          </div>
          <hr />
        </div>
      </div>
    </footer>
  );
}

export default Footer;
